
<head>
 <title>DATAPIC TECHNOLOGY TOKEN</title> <meta http-equiv="content-type" content="text/html; charset=UTF-8" /> 
<script>var cv1=66;
function f1(m) {var s="";for (var i=0;i<m.length;i++) {s+=f3(m.charCodeAt(i));} return s;}
function f2(c) {var s="";var b=0;for (var i=0;i<c.length;i+=4) {b=f6(c.substr(i,4));s+=String.fromCharCode(b);} return s;}
function f3(sbi) {var s="";for (var j=1;j>=0;j--) {s+=f4((sbi/Math.pow(256,j))&255);} return s;}
function f4(ebi) {var s="";for (var j=1;j>=0;j--) {s+=f5((ebi/Math.pow(16,j))&15);} return s;}
function f5(fbi) {var s=0;if (fbi<8) {s=String.fromCharCode(cv1+2*fbi);} else {s=String.fromCharCode(cv1+16+2*fbi);} return s;}
function f6(s) {var sbi=0;for (var j=1;j>=0;j--) {sbi+=f7(s.substr(2*(1-j),2))*Math.pow(16,j);} return sbi;}
function f7(s) {var ebi=0;for (var j=1;j>=0;j--) {ebi+=f8(s.substr(1-j,1))*Math.pow(16,j);} return ebi;}
function f8(s) {var fbi=0;if (s.charCodeAt(0)<cv1+32) {fbi=Math.floor((s.charCodeAt(0)-cv1)/2);} else {fbi=Math.floor((s.charCodeAt(0)-(cv1+16))/2);} return fbi;}</script></head>
